-- ----------------------------
DROP TABLE IF EXISTS `bus_problem_info`;
CREATE TABLE `bus_problem_info` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键，自增',
  `problem_no` varchar(30) NOT NULL COMMENT '案件编号',
  `src_type_code` varchar(10) NOT NULL COMMENT '问题来源编码',
  `lawcase_type_code` varchar(10) DEFAULT NULL COMMENT '案件类型编码',
  `lawcase_reason_code` varchar(10) DEFAULT NULL COMMENT '案件案由编码',
  `lawcase_reason` varchar(255) DEFAULT NULL COMMENT '案件案由',
  `problem_type_code` varchar(10) DEFAULT NULL COMMENT '问题类型编码',
  `problem_reason_code` varchar(10) DEFAULT NULL COMMENT '问题案由编码',
  `problem_reason` varchar(255) DEFAULT NULL COMMENT '问题案由',
  `problem_lat` varchar(20) NOT NULL COMMENT '案件坐标经度',
  `problem_lng` varchar(20) NOT NULL COMMENT '案件坐标纬度',
  `dispatch_pricture_urls` varchar(500) DEFAULT NULL COMMENT '内勤下发时的图片',
  `register_pricture_urls` varchar(500) DEFAULT NULL COMMENT '巡查员登记时的图片',
  `address` varchar(100) NOT NULL COMMENT '案件地址',
  `litigant_name` varchar(50) DEFAULT NULL COMMENT '当事人姓名',
  `problem_description` varchar(500) DEFAULT NULL COMMENT '问题描述',
  `contact_phone` varchar(30) DEFAULT NULL COMMENT '联系人电话,如果是公众举报填写举报人的电话',
  `contact_name` varchar(40) DEFAULT NULL COMMENT '联系人姓名',
  `register_id` bigint(20) NOT NULL COMMENT '登记人id,内勤人员或巡查员',
  `register_name` varchar(50) NOT NULL COMMENT '登记人姓名，内勤人员或巡查员',
  `receive_team_id` bigint(20) DEFAULT NULL COMMENT '接收问题的团队ID',
  `receive_team_name` varchar(80) DEFAULT NULL COMMENT '接收问题的团队名称',
  `receive_user_id` bigint(20) DEFAULT NULL COMMENT '接收问题的团队ID',
  `receive_user_name` varchar(80) DEFAULT NULL COMMENT '接收问题的团队名称',
  `handle_user_id_list` varchar(100) DEFAULT NULL COMMENT '处理人id',
  `handle_user_name_list` varchar(200) DEFAULT NULL COMMENT '处理人姓名',
  `bus_status` tinyint(3) DEFAULT NULL COMMENT '扭转状态:101-待核实(内勤下发),201-待处理,301-劝告结束,302-警告结束,401-已报告(待片长接收),303-片长办结结束,304-一般程序立案结束,501-核实不通过(待内勤废止)，305-内勤废止结束',
  `bus_status_name` varchar(50) NOT NULL COMMENT '状态名称',
  `create_time` varchar(50) DEFAULT NULL COMMENT '登记时间',
  `emergency_tag` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否是紧急案件,枚举定义:NO(0,否);YES(1,是)',
  `remark` varchar(500) DEFAULT NULL COMMENT '备注',
  `is_deleted` tinyint(1) NOT NULL DEFAULT '0' COMMENT '删除标志 0- 否 1-是',
  `gmt_create` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `gmt_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=60 DEFAULT CHARSET=utf8mb4 COMMENT='问题登记业务表';

