-- ----------------------------
-- Table structure for `user`
-- ----------------------------
DROP TABLE IF EXISTS `user`;
CREATE TABLE `user` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `user_account` varchar(50) NOT NULL DEFAULT '' COMMENT '用户账户',
  `user_password` varchar(64) NOT NULL DEFAULT '' COMMENT '用户密码',
  `update_password_time` timestamp NULL DEFAULT NULL COMMENT '修改密码时间',
  `user_name` varchar(80) NOT NULL DEFAULT '' COMMENT '用户名',
  `mobile_no` varchar(30) NOT NULL DEFAULT '' COMMENT '手机号码',
  `email` varchar(30) NOT NULL DEFAULT '' COMMENT '邮箱地址',
  `job` varchar(20) NOT NULL DEFAULT '' COMMENT '职位',
  `birthday` datetime DEFAULT NULL COMMENT '出生年月',
  `user_photo` bigint(20) DEFAULT NULL COMMENT '用户头像,对应资源表中的id',
  `id_card_no` varchar(20) NOT NULL DEFAULT '' COMMENT '身份证号',
  `gender` tinyint(3) unsigned DEFAULT NULL COMMENT '性别,枚举定义:MALE(1,男);FEMALE(0,女);',
  `dept_id` bigint(20) unsigned DEFAULT NULL COMMENT '所属部门ID',
  `address` varchar(255) DEFAULT NULL COMMENT '联系地址',
  `locked` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否锁定,枚举定义:LOCKED(1,已锁定);UNLOCKED(0,未锁定);',
  `locked_time` timestamp NULL DEFAULT NULL COMMENT '锁定时间',
  `enabled` tinyint(3) NOT NULL DEFAULT '0' COMMENT '是否禁用,枚举定义:ENABLED(1,已禁用);UNENABLED(0,正常);',
  `expired` tinyint(3) NOT NULL DEFAULT '0' COMMENT '账号是否过期,枚举定义:EXPIRED_YES(1,过期);EXPIRED_NO(0,未过期);',
  `is_deleted` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否删除,枚举定义:DELETED_NO(0,未删除);DELETED_YES(1,已删除);',
  `gmt_create` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `gmt_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `user_id_create` bigint(20) unsigned NOT NULL DEFAULT '0' COMMENT '创建人id',
  `user_id_modified` bigint(20) unsigned DEFAULT NULL COMMENT '最后修改人id',
  `leader_id` bigint(20) DEFAULT NULL COMMENT '直接汇报人',
  PRIMARY KEY (`id`),
  KEY `idx_user_accout` (`user_account`,`is_deleted`) USING BTREE,
  KEY `idx_mobile_no` (`mobile_no`,`is_deleted`) USING BTREE,
  KEY `idx_email` (`email`,`is_deleted`) USING BTREE,
  KEY `idx_dept_id` (`dept_id`,`is_deleted`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=93 DEFAULT CHARSET=utf8mb4 COMMENT='用户表';

