-- Table structure for `user_expand`
-- ----------------------------
DROP TABLE IF EXISTS `user_expand`;
CREATE TABLE `user_expand` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `property_name` varchar(50) NOT NULL DEFAULT '' COMMENT '属性名',
  `property_value` varchar(255) NOT NULL DEFAULT '' COMMENT '属性值',
  `user_id` bigint(20) unsigned NOT NULL COMMENT '用户id',
  `gmt_create` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `gmt_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `is_deleted` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否删除：0未删除，1已删除',
  `user_id_create` bigint(20) unsigned DEFAULT NULL COMMENT '创建人id',
  `user_id_modified` bigint(20) unsigned DEFAULT NULL COMMENT '最后修改人id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=477 DEFAULT CHARSET=utf8mb4 COMMENT='用户信息拓展表';

-- ----------------------------
-- Records of user_expand
-- ----------------------------

-- ----------------------------
-- Table structure for `user_register`
-- ----------------------------
DROP TABLE IF EXISTS `user_register`;
CREATE TABLE `user_register` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID',
  `bus_id` varchar(50) NOT NULL DEFAULT '' COMMENT '业务ID',
  `user_account` varchar(50) NOT NULL DEFAULT '' COMMENT '用户账号',
  `user_password` varchar(64) NOT NULL DEFAULT '' COMMENT '用户密码',
  `user_name` varchar(80) NOT NULL DEFAULT '' COMMENT '用户名',
  `mobile_no` varchar(30) NOT NULL DEFAULT '' COMMENT '手机号码',
  `email` varchar(30) DEFAULT '' COMMENT '邮箱地址',
  `job` varchar(20) DEFAULT '' COMMENT '职位',
  `birthday` datetime DEFAULT NULL COMMENT '生日',
  `user_photo` bigint(20) unsigned DEFAULT NULL COMMENT '用户头像，对应资源表中的id',
  `id_card_no` varchar(20) DEFAULT '' COMMENT '身份证号',
  `gender` tinyint(3) unsigned DEFAULT '1' COMMENT '性别：1男，0女',
  `dept_id` bigint(20) unsigned DEFAULT NULL COMMENT '所属部门id',
  `examine_status` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '审核状态，枚举定义:WAIT(1,待审核);PASS(2,审核通过);NO_PASS(3,审核不通过);',
  `examine_user_id` bigint(20) unsigned DEFAULT NULL COMMENT '审核人id',
  `team_type_code` varchar(10) DEFAULT '' COMMENT '团队类型编码（注册的时候选的团队团队类型）',
  `gmt_create` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `gmt_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `is_deleted` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否删除：0未删除，1已删除',
  `user_id_create` bigint(20) unsigned DEFAULT NULL COMMENT '创建人id',
  `user_id_modified` bigint(20) unsigned DEFAULT NULL COMMENT '最后修改人id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=88 DEFAULT CHARSET=utf8mb4 COMMENT='用户注册信息表';

-- ----------------------------
-- Records of user_register
-- ----------------------------

