-- ----------------------------
-- Table structure for `user_role`
-- ----------------------------
DROP TABLE IF EXISTS `user_role`;
CREATE TABLE `user_role` (
  `id` bigint(20) unsigned NOT NULL AUTO_INCREMENT COMMENT 'id',
  `user_id` bigint(20) unsigned NOT NULL COMMENT '用户ID',
  `role_id` bigint(20) unsigned NOT NULL COMMENT '角色ID',
  `start_time` timestamp NOT NULL COMMENT '开始时间',
  `end_time` timestamp NOT NULL COMMENT '结束时间',
  `is_deleted` tinyint(3) unsigned NOT NULL COMMENT '是否删除,枚举定义:DELETED_NO(0,未删除);DELETED_YES(1,已删除);',
  `gmt_create` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `gmt_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `user_id_create` bigint(20) unsigned DEFAULT NULL COMMENT '创建人id',
  `user_id_modified` bigint(20) unsigned DEFAULT NULL COMMENT '最后修改人id',
  PRIMARY KEY (`id`),
  KEY `idx_user_id` (`user_id`,`is_deleted`) USING BTREE,
  KEY `idx_role_id` (`role_id`,`is_deleted`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=30 DEFAULT CHARSET=utf8mb4 COMMENT='用户与角色关系表';

-- ----------------------------
-- Records of user_role
-- ----------------------------

-- ----------------------------
-- Table structure for `user_secret_question`
-- ----------------------------
DROP TABLE IF EXISTS `user_secret_question`;
CREATE TABLE `user_secret_question` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `user_account` varchar(50) NOT NULL COMMENT '用户账号',
  `question_id` bigint(20) NOT NULL COMMENT '问题id',
  `question_answer` varchar(200) NOT NULL DEFAULT '' COMMENT '问题答案（加密）',
  `seq` int(11) NOT NULL DEFAULT '0' COMMENT '顺序',
  `gmt_create` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `gmt_modified` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `is_deleted` tinyint(3) unsigned NOT NULL DEFAULT '0' COMMENT '是否删除：0未删除，1已删除',
  `user_id_create` bigint(20) unsigned DEFAULT NULL COMMENT '创建人id',
  `user_id_modified` bigint(20) unsigned DEFAULT NULL COMMENT '最后修改人id',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=57 DEFAULT CHARSET=utf8mb4 COMMENT='用户密保问题表';

